import React from "react";
import "../components/SignIn/style.scss";
import TextField from "@material-ui/core/TextField";
import { Box } from "@material-ui/core";
let width = 240;
let marginBottom = 5;
let headeFontSize = 20;
function Signin() {
  return (
    <React.Fragment>
      <div className="login-page">
        <div className="form">hoho</div>
      </div>
      <div className="login-page">
        <div className="form">
          <form
            className="login-form"
            // onSubmit={this.handleSubmit}
          >
            <div
              style={{
                display: "flex",
                flexDirection: "row",
                paddingLeft: 15,
                fontFamily: "Roboto",
              }}
            >
              <p style={{ color: "grey", fontSize: headeFontSize }}>
                Sign in to
              </p>
              <Box width={5} />
              <p style={{ fontWeight: "bold", fontSize: headeFontSize }}>
                Web Admin
              </p>
            </div>

            <TextField
              style={{ width: width, marginBottom: marginBottom }}
              type="text"
              variant="standard"
              label="username"
              name="username"
              // onChange={(event) => this.handleChange(event)}
            />
            <TextField
              style={{ width: width, marginBottom: marginBottom }}
              variant="standard"
              type="password"
              label="password"
              name="password"
              // onChange={(event) => this.handleChange(event)}
            />
            <div
              style={{
                textAlign: "right",
                color: "grey",
                paddingRight: 10,
                margin: "5px 5px 15px 0",
              }}
            >
              <p style={{ fontSize: 12, fontWeight: "bold" }}>
                Forgot password?
              </p>
            </div>
            <button type="submit">login</button>
          </form>
        </div>
      </div>
    </React.Fragment>
  );
}

export default Signin;
